// Navbar.js
import React from "react";
import LoggedOutNavbar from "./LoggedOutNavbar";
import LoggedInNavbar from "./LoggedInNavbar";

const Navbar = ({ isLoggedIn, logout }) => {
  return (
    <>
      {isLoggedIn ? (
        <LoggedInNavbar handleLogout={logout} />
      ) : (
        <LoggedOutNavbar />
      )}
    </>
  );
};

export default Navbar;
